webpackJsonp([2153],{"./node_modules/json-loader/index.js!./.cache/json/articles-bootstrap-bootstrap-buttons.json":function(t,o){t.exports={data:{markdownRemark:{html:'<h2>Bootstrap Buttons</h2>\n<p>The Bootstrap framework provides you with various styling options for buttons. These styles help you provide a visual representation to the user of what the button may do.</p>\n<h4>How To Use:</h4>\n<p>To use bootstrap buttons you follow the same steps that you would to create a button in HTML except you also apply the applicable CSS class to the button. A code example has been provided below.</p>\n<p><strong>Code Example:</strong></p>\n<p><code>&#x3C;button type="button" class="btn btn-primary">Primary&#x3C;/button></code></p>\n<p><button type="button" class="btn btn-primary">Primary</button></p>\n<h4>Bootstrap Button Class List:</h4>\n<p>This is a list of the CSS classes that bootstrap provides for buttons.</p>\n<p><code>.btn</code> This is bootstrap\'s basic button.</p>\n<p><button type="button" class="btn">Basic</button></p>\n<p><code>.btn-default</code> This is bootstrap\'s default button.</p>\n<p><button type="button" class="btn btn-default">Default</button></p>\n<p><code>.btn-primary</code> This is bootstrap\'s primary button.</p>\n<p><button type="button" class="btn btn-primary">Primary</button></p>\n<p><code>.btn-success</code> This is bootstrap\'s success button.</p>\n<p><button type="button" class="btn btn-success">Success</button></p>\n<p><code>.btn-info</code> This is bootstrap\'s info button.</p>\n<p><button type="button" class="btn btn-info">Info</button></p>\n<p><code>.btn-warning</code> This is bootstrap\'s warning button.</p>\n<p><button type="button" class="btn btn-warning">Warning</button></p>\n<p><code>.btn-danger</code> This is bootstrap\'s danger button.</p>\n<p><button type="button" class="btn btn-danger">Danger</button></p>\n<p><code>.btn-link</code> This is bootstrap\'s link button.</p>\n<p><button type="button" class="btn btn-link">Link</button></p>\n<p><em>Note: Do not include the dot in the HTML Class Attribute, referring to the classes with a dot is only used when adjusting the classes in CSS.</em></p>\n<h4>More Information:</h4>\n<ul>\n<li><a href="/articles/bootstrap/bootstrap-get-started">Bootstrap Get Started</a></li>\n</ul>',frontmatter:{title:"Bootstrap Buttons",parent:"/home/stuart/guides/src/pages/articles/bootstrap/bootstrap-buttons/index.md absPath of file"}}},pathContext:{slug:"/articles/bootstrap/bootstrap-buttons/"}}}});
